const UseEffect = () => {
  let [num, setNum] = useState(0);

  const Incrise = () => {
    setNum(num + 1);
  };
  return (
    <div className="container-fluid">
      <div className="header text-center display-6  text-bg-dark">
        Effect Example
      </div>
      <h1></h1>
      <button className="btn btn-primary mt-5" onClick={Incrise}>
        +
      </button>
    </div>
  );
};

export default UseEffect;
